selector_to_html = {"a[href=\"#setup\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">Setup<a class=\"headerlink\" href=\"#setup\" title=\"Link to this heading\">#</a></h4><p>First, the following software needs to be installed on your system:</p>", "a[href=\"#run-notebooks-locally\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Run notebooks locally<a class=\"headerlink\" href=\"#run-notebooks-locally\" title=\"Link to this heading\">#</a></h3><h4>Setup<a class=\"headerlink\" href=\"#setup\" title=\"Link to this heading\">#</a></h4><p>First, the following software needs to be installed on your system:</p>", "a[href=\"#opening-jupyter-notebooks\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">Opening Jupyter notebooks<a class=\"headerlink\" href=\"#opening-jupyter-notebooks\" title=\"Link to this heading\">#</a></h4><p>The Jupyter notebook of exercise with code can be downloaded from the website (top-right corner).</p><p>To run one of those notebooks, you can open them in Jupyter Lab:</p>", "a[href=\"#contributing\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Contributing<a class=\"headerlink\" href=\"#contributing\" title=\"Link to this heading\">#</a></h2><p>This book is still a work in progress. If you spot any error, you can proceed in two ways:</p>", "a[href=\"#introduction\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Introduction<a class=\"headerlink\" href=\"#introduction\" title=\"Link to this heading\">#</a></h1><p>Welcome to this interactive web book!</p><p>This resource contains a curated selection of exercises from the book <a class=\"reference external\" href=\"https://uppsala.instructure.com/courses/102131/files/7991063?module_item_id=1296223\"><em>Exercise Manual for Automatic Control</em></a>.\nThis collection is here to kickstart your 1RT485 exercise sessions and guide you through solving exercises.\nTake the time to engage with each problem and work through the solutions thoroughly!</p>", "a[href=\"#using-binder\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Using Binder<a class=\"headerlink\" href=\"#using-binder\" title=\"Link to this heading\">#</a></h3><p>The easiest way to interactively run the MATLAB code reported in the exercises\u2019 solutions is using Binder. Binder is a free and open source service that allows to open and run Jupyter Notebooks from your browser.</p><p>To run the code in Binder, just click on the rocket logo in the top navigation bar, and then on \u201cBinder\u201d. When the notebook gets opened in Binder, select the <strong>Matlab (via Octave)</strong> kernel<a class=\"footnote-reference brackets\" href=\"#octave\" id=\"id2\" role=\"doc-noteref\"><span class=\"fn-bracket\">[</span>1<span class=\"fn-bracket\">]</span></a>.</p>", "a[href=\"#how-to-run-the-code\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">How to Run the Code<a class=\"headerlink\" href=\"#how-to-run-the-code\" title=\"Link to this heading\">#</a></h2><h3>Using Binder<a class=\"headerlink\" href=\"#using-binder\" title=\"Link to this heading\">#</a></h3><p>The easiest way to interactively run the MATLAB code reported in the exercises\u2019 solutions is using Binder. Binder is a free and open source service that allows to open and run Jupyter Notebooks from your browser.</p><p>To run the code in Binder, just click on the rocket logo in the top navigation bar, and then on \u201cBinder\u201d. When the notebook gets opened in Binder, select the <strong>Matlab (via Octave)</strong> kernel<a class=\"footnote-reference brackets\" href=\"#octave\" id=\"id2\" role=\"doc-noteref\"><span class=\"fn-bracket\">[</span>1<span class=\"fn-bracket\">]</span></a>.</p>", "a[href=\"#octave\"]": "<aside class=\"footnote brackets\" id=\"octave\" role=\"doc-footnote\">\n<span class=\"label\"><span class=\"fn-bracket\">[</span><a href=\"#id2\" role=\"doc-backlink\">1</a><span class=\"fn-bracket\">]</span></span>\n<p>Octave is a GNU-GPL scientific programming language that offers, in many cases, an almost-drop-in replacement to MATLAB. See <a class=\"reference external\" href=\"https://octave.org\">the website</a> for more information.</p>\n</aside>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: false,
                placement: 'auto-start', maxWidth: 500, interactive: true, boundary: document.body, appendTo: document.body,
                onShow(instance) {MathJax.typesetPromise([instance.popper]).then(() => {var isFirefox=typeof InstallTrigger!=='undefined';if(isFirefox&&window.MathJax&&MathJax.startup&&MathJax.startup.output&&MathJax.startup.output.name==="SVG"){const svgs=instance.popper.querySelectorAll('svg');svgs.forEach(svg=>{let bbox=svg.getBBox(),x=bbox.x,y=bbox.y,width=bbox.width,height=bbox.height;svg.setAttribute('width',width);svg.setAttribute('height',height);svg.setAttribute('viewBox',`${x} ${y} ${width} ${height}`);});let rescale=0.015;svgs.forEach(svg=>{let bbox=svg.getBBox(),width=bbox.width,height=bbox.height;svg.setAttribute('width',width*rescale);svg.setAttribute('height',height*rescale);});}});},
            });
        };
    };
    console.log("tippy tips loaded!");
};
